        public static bool NoDup1(Type enumType, out string TheDupItemName1, out string TheDupItemName2)
        {
            TheDupItemName1 = string.Empty;
            TheDupItemName2 = string.Empty;
            string _TheDupItemName1 = string.Empty;

            var enumValues = Enum.GetValues(enumType);

            HashSet<int> valueSet = new HashSet<int>();
            foreach (var enumValue in enumValues)
            {
                int intEnumValue = (int)enumValue;
                if (valueSet.Contains(intEnumValue))
                {
                    _TheDupItemName1 = Enum.GetName(enumType, enumValue);
                }
                else
                {
                    valueSet.Add(Convert.ToInt32(enumValue));
                }
            }

            if (valueSet.Count == enumValues.Length)
            {
                return true;
            }
            else
            {
                var enumNames = Enum.GetNames(enumType);
                var DupItemsNames = enumNames.Where(itemName => !itemName.Equals(_TheDupItemName1) && Enum.Parse(enumType, itemName).Equals(Enum.Parse(enumType, _TheDupItemName1)));

                TheDupItemName2 = DupItemsNames.First();
                return false;
            }
        }

        public static bool NoDup2(Type enumType)
        {
            return !Enum.GetNames(enumType).All(outerName => Enum.GetNames(enumType).Any(innerName => innerName == outerName ? true : Enum.Parse(enumType, innerName) != Enum.Parse(enumType, outerName)));
        }


        public static bool NoDup3(Type enumType, out string Name1, out string Name2)
        {
            string _Name1 = string.Empty;
            string _Name2 = string.Empty;

            bool NoDuplicate = Enum.GetNames(enumType).All(outerName => Enum.GetNames(enumType).Any(innerName =>
                    {
                        if (innerName == outerName)
                        {
                            return true;
                        }
                        else
                        {
                            if (Enum.Parse(enumType, innerName) != Enum.Parse(enumType, outerName))
                            {
                                return true;
                            }
                            else
                            {
                                _Name1 = outerName;
                                _Name2 = innerName;
                                return false;
                            }
                        }
                    }
                )
                );

            Name1 = _Name1;
            Name2 = _Name2;

            return NoDuplicate;
        }

